Here are a few popular compiler optimization techniques:

1.  **Dead Code Elimination (DCE)**: This technique removes code that is never executed. It's useful for reducing the size of the binary and improving performance.

    Example Code:

    ```c
    int x = 5;
    if (x > 10) {
        printf("x is greater than 10\n");
    }
    ```

    In this example, the code inside the if statement will never be executed because x is 5, which is less than 10. A compiler that supports DCE will remove the code inside the if statement.

2.  **Constant Folding**: This technique evaluates constant expressions at compile-time, eliminating the need for runtime evaluation.

    Example Code:

    ```c
    int x = 5 + 3;
    ```

    In this example, the compiler will evaluate the expression 5 + 3 at compile-time and replace it with the result, which is 8.

3.  **Common Subexpression Elimination (CSE)**: This technique eliminates duplicate expressions in the code, reducing the number of computations.

    Example Code:

    ```c
    int x = 5;
    int y = x + 3;
    int z = x + 3;
    ```

    In this example, the expression x + 3 is evaluated twice. A compiler that supports CSE will eliminate the duplicate expression and replace it with a single evaluation.

4.  **Loop Unrolling**: This technique unrolls loops to reduce the number of iterations and improve performance.

    Example Code:

    ```c
    for (int i = 0; i < 10; i++) {
        printf("%d\n", i);
    }
    ```

    In this example, the loop iterates 10 times. A compiler that supports loop unrolling will unroll the loop, eliminating the need for the loop counter and reducing the number of iterations.

5.  **Register Allocation**: This technique assigns variables to registers to improve performance by reducing memory accesses.

    Example Code:

    ```c
    int x = 5;
    int y = x + 3;
    printf("%d\n", y);
    ```

    In this example, the compiler will assign the variable x to a register and use the register to compute the value of y. This reduces the number of memory accesses and improves performance.

